import React from "react";
import Card from "./VideoSummary"
import '../components/VideoList.scss';

export default function VideoList(videoData, activeVideoId, changeActiveVideo) {
    return (
        <>
        <section className="next-videos">
        {videoData.filter((card) => {
          return card.id !== activeCardId;
        })
        .map((content) => (
            <Card 
            key={content.id} 
            id={content.id}
            changeActiveVideo={changeActiveVideo}
            image={content.image} 
            title={content.title} 
            channel={content.channel}/>
        ))}
        </section>
    </>
    );
}
